The '''Eclipse Foundation''' is a not-for-profit, member supported corporation that acts as the steward of Eclipse, an open source community focused on "building an open development platform {{sic|hide=y|comprised| of}} extensible frameworks, tools and runtimes for building, deploying and managing software across the lifecycle." The most well-known of the [[List of Eclipse projects|Eclipse projects]] is the [[Eclipse (software)|Eclipse platform]], a multilanguage software development environment and [[Integrated_development_environment|IDE]].<ref name="foundation">{{cite web|title=About the Eclipse Foundation|url=http://www.eclipse.org/org/|publisher=The Eclipse Foundation|accessdate=14 January 2012}}</ref>
The Eclipse Foundation's stated aim is to "cultivate both an open source community and an ecosystem of complementary products and services."<ref name="foundation"/> It is considered a 'third generation'<ref>[[François Letellier]] (2008), [http://flet.netcipia.net/xwiki/bin/download/Main/publications%2Dfr/GEM2008%2DFLetellier%2DSubmittedPaper.pdf Open Source Software: the Role of Nonprofits in Federating Business and Innovation Ecosystems], AFME 2008.</ref> open-source organisation.
== History == In 2003&ndash;2004 the Eclipse Consortium, an consortium of software industry vendors,<ref name="Eclipse Consortium">{{cite web | work=Press Release | title=Eclipse Forms Independent Organization | url=http://www.eclipse.org/org/press-release/feb2004foundationpr.html | accessdate=2004-02-04}}</ref> founded The Eclipse Foundation, a not-for-profit legal entity to lead and develop Eclipse.
